import { Link } from 'react-router-dom';
import Element from "./DashElement";
import axios from 'axios';
import { useState, useEffect } from 'react';
import ebayLogo from '../images/ebay-logo.png'

const serverUrl = 'http://localhost:8080'

function UserDashboard(props) {

    const [ userData, setUserData ] = useState();

    useEffect(() => {
        async function fetchData(){
            await axios.get(serverUrl + '/getlistings')
                .then(res => {
                    console.log(res.data);
                    let dataArray = res.data.GetMyeBaySellingResponse.ActiveList.ItemArray.Item
                    setUserData(dataArray);   
                    console.log(dataArray);
                    console.log(userData);
                })
            .catch(err => console.log(err))
        }
        fetchData();
    },[])

    props.funcNav('usr');

    var date = new Date();
    var year = date.getFullYear();
    var month = date.getMonth();
    var day = date.getDate();
    var hours = date.getHours();
    var ampm = hours >= 12 ? 'pm' : 'am';
    const today = month + " - " + day + " - " + year;

    const weekDay = () => {
        const weekday = ["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];
        let day = weekday[date.getDay()];
        // console.log(day);
        // console.log(hours);
        return day;
    };

    const greeting = () => {
        if(ampm === 'am') return 'Good Monring'
        if(ampm === 'pm' && hours < 17) return 'Good Afternoon'
        if(ampm === 'pm' && hours >= 17) return 'Good Evening'
    }

    function Listings () {
        if (userData) {
            return (
                userData.map((data, key) => {
                    return(
                            <tr>
                                <td>
                                    <div className="accordion" id="accordionFlushExample">
                                            <div className="accordion-item">
                                                <h2 className="accordion-header">
                                                <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target={`#flush-collapse${key}`} aria-expanded="false" aria-controls="flush-collapseOne">
                                                {data.Title._text}
                                                </button>
                                                </h2>
                                                <div id={`flush-collapse${key}`} className="accordion-collapse collapse" data-bs-parent="#accordionFlushExample">
                                                <div className="accordion-body">
                                                    <div className='container'>
                                                        <div className='row'>
                                                            <div className='col'>
                                                                {data.ListingDetails.StartTime._text}
                                                            </div>
                                                            <div className='col'>
                                                                <a href={data.ListingDetails.ViewItemURL._text} target="_blank">View in  <img src={ebayLogo} style={{height:"1rem", width:"1rem"}} /> </a>
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                                </div>
                                            </div>
                                    </div>
                                    </td>
                                    <td>{data.TimeLeft._text}</td>
                                    <td>${data.SellingStatus.CurrentPrice._text}</td>
                            </tr>
                    )
                }) 
            )
        } else {
            return (
                <>
                    <br />
                    <div class="spinner-border" role="status">
                        <span class="visually-hidden">Loading...</span>
                    </div>
                </>
            )
        }
    }

    return (
        <>
            <div className="user-dash">
                <div className="row">
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title={greeting()}
                            subtitle='Timothy'
                            text={(
                                <>
                                <div>
                                    <b>
                                        {weekDay()}
                                    </b>   
                                </div>
                                <div>
                                    {today}
                                </div>
                                </>
                                )}
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Consignments'
                            subtitle='Total Items Listed'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    53
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Sold'
                            subtitle='Total Items Sold'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    35
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                            to=''
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Credit'
                            subtitle='Balance'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    $ 1,235.50
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                        />
                    </div>
                </div>
                <div className="row">
                    <div className="col">
                        <Element
                            class='dash-main' 
                            title='CONSIGNMENTS'
                            text=''
                            body={
                                <table className='table table-dark table-striped table-hover'>
                                    <thead>
                                        <tr>
                                            <th scope='col'>Listing</th>
                                            <th scope='col'>Time</th>
                                            <th scope='col'>Price</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        <Listings/>
                                    </tbody>
                                </table>
                            }
                        /> 
                    </div>
                </div>
            </div>
        </>
    )
}

export default UserDashboard;
